import Foundation
import XCTest

@testable import SystemStrings

// MARK: - ARKit Tests

@available(iOS 11.0, *)
final class ARKitStringsTests: XCTestCase {

    override func tearDown() {
        super.tearDown()
        Util｜ARKit.preferredLocalization = nil
    }

